import React from 'react';
import { NavLink } from "react-router-dom";


const About = () => {

    const Loginbutton = () => {

        if (state) {
            return <div>
                <button ><NavLink className="btn" to="/signout">logout</NavLink></button>
            </div>
        }
        else {
            return <div>
                <button ><NavLink className="btn" to="/signin">login</NavLink></button>

            </div>
        }

    }
    return (
        <>

            <header className="header">

                <div id="menu-btn" className="fas fa-bars"></div>

                <NavLink className="logo" to="/"> Car<span>Rent</span></NavLink>



                <nav className="navbar">
                    <NavLink to="/">Home</NavLink>
                    <NavLink to="/rentcar">Rent Cars</NavLink>
                    <NavLink to="/about">About</NavLink>
                    <a href="#services">Testimonial</a>
                    <a href="#contact">Contact</a>
                </nav>
                <div id="login-btn">
                    <Loginbutton />
                </div>

            </header>
        </>

    );
};

export default About;
